// Concerns.js

import React from 'react';
import Header from './Header'; // Assuming Header.js is in the same folder
import './Concerns.css'; // Assuming you have a Concerns.css file for styling

const Concerns = ({ navigateTo }) => {
  const handleConcernClick = (concern) => {
    console.log(`Selected concern: ${concern}`);
    navigateTo(concern.toLowerCase().replace(' ', '-')); // Navigate to the selected concern page
  };

  return (
    <div className="concerns-page">
      <Header navigateTo={navigateTo} />
      <h2>Choose Your Concern</h2>
      <div className="concerns-grid">
        <div className="concern dryness" onClick={() => handleConcernClick('Dryness')}>
          <h3>Dryness</h3>
          <p>Products to combat dry hair</p>
        </div>
        <div className="concern damage" onClick={() => handleConcernClick('Damage')}>
          <h3>Damage</h3>
          <p>Products to repair damaged hair</p>
        </div>
        <div className="concern frizz" onClick={() => handleConcernClick('Frizz')}>
          <h3>Frizz</h3>
          <p>Products to manage frizzy hair</p>
        </div>
        <div className="concern curl-support" onClick={() => handleConcernClick('Curl Support')}>
          <h3>Curl Support</h3>
          <p>Products to enhance curl definition</p>
        </div>
      </div>
    </div>
  );
};

export default Concerns;
